const Nav = ({topics, onChangeMode})=>{
 
    const topicList = topics.map((topic)=>
      <li key={topic.id}>
        <a href={'/read/'+topic.id} onClick={event =>{
          event.preventDefault();
          onChangeMode(topic.id);
        }}>
          {topic.title}
        </a>
      </li>
    );
  
    return(
      <nav>
        <ol>
          {topicList}
        </ol>
      </nav>
    );
  }
  

const Article = ({title, body})=>{
    return(
    <article>
            <h3>{title}</h3>
            {body}
    </article>
    );
}


const Header = ({title, onChangeMode})=>{
    return(
    <header>
        <h1>
        <a href="/title/" onClick={(event)=>{
            event.preventDefault();
            onChangeMode();
            }
        }>{title}</a>
        </h1>
    </header>
    );
}

export {Nav,Header,Article};
